  \"2016-03-31T23:55:54.496055\",\n\t\"name\": \"enviroatlas-manure-application-to-agricultural-lands-from-confined-animal-feeding-operati-2006\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset contains data
  on the mean livestock manure application to cultivated crop and hay/pasture lands
  by 12-digit Hydrologic Unit (HUC) in 2006. Livestock manure inputs to cultivated
  crop and hay/pasture lands were estimated using county-level estimates of recoverable
  animal manure from confined feeding operations compiled for 2007. Recoverable manure
  is defined as manure that is collected, stored, and available for land application
  from confined feeding operations. County-scale data on livestock populations-needed
  to calculate manure inputs-were only available for the year 2007 from the USDA Census
  of Agriculture (http://www.agcensus.usda.gov/index.php). We acquired county-level
  data describing total farm-level inputs (kg N/yr) of recoverable manure to individual
  counties in 2007 from the International Plant Nutrition Institute (IPNI) Nutrient
  Geographic Information System (NuGIS; http://www.ipni.net/nugis). These data were
  converted to per area rates (kg N/ha/yr) of manure N inputs by dividing the total
  N input by the land area (ha) of combined cultivated crop and hay/pasture (agricultural)
  lands within a county as determined from county-level summarization of the 2006
  NLCD. We distributed county-specific, per area N inputs rates to cultivated crop
  and hay/pasture lands (30 x 30 m pixels) within the corresponding county. Manure
  data described here represent an average input to a typical agricultural land type
  within a county, i.e., they are not specific to individual crop types. This dataset
  was produced by the US EPA to support research and online mapping activities related
  to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to
  interact with a web-based, easy-to-use, mapping application to view and analyze
  multiple ecosystem services for the contiguous United States. The dataset is available
  as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an
  EnviroAtlas map service. Additional descriptive information about each attribute
  in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
